import './assets/css/App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import Index from './components/Index';
import Router from './Router';

function App() {
  return (
    <div className="App">

      <Header />
      <Index />

      <Router/>
      {/* Importar el header */}

      <Footer />
    </div>
  );
}

export default App;
